import React from 'react';
import "./Sidebar.css";
import SidebarRow from './SidebarRow';
import LocalHospitalIcon from '@material-ui/icons/LocalHospital';
import EmojiFlagsIcon from '@material-ui/icons/EmojiFlags';
import PeopleIcon from '@material-ui/icons/People';
import ChatIcon from '@material-ui/icons/Chat';
import StorefrontIcon from '@material-ui/icons/Storefront';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
import ExpandMoreOutlinedIcon from '@material-ui/icons/ExpandMoreOutlined';



function Sidebar() {
    return (
        <div className="sidebar">
            <SidebarRow src='https://scontent.fboi1-1.fna.fbcdn.net/v/t1.0-9/p843x403/82431201_1216929775163662_6084152552985722880_o.jpg?_nc_cat=105&_nc_sid=09cbfe&_nc_ohc=UTFH0MVF5PQAX9oJtSY&_nc_ht=scontent.fboi1-1.fna&tp=6&oh=68353c64f7ebf13374d5c373f8cd5e16&oe=5F9789B8' title='Bobby' />
            <SidebarRow Icon={LocalHospitalIcon} title="COVID-19 Information Center" />
            <SidebarRow Icon={EmojiFlagsIcon} title="Pages" />
            <SidebarRow Icon={PeopleIcon} title="Friends" />
            <SidebarRow Icon={ChatIcon} title="Messenger" />
            <SidebarRow Icon={StorefrontIcon} title="Marketplace" />
            <SidebarRow Icon={VideoLibraryIcon} title="Videos" />

            <SidebarRow Icon={ExpandMoreOutlinedIcon} title="Marketplace" />

        </div>
    )
}

export default Sidebar
